import ExpenseItem from "./components/ExpenseItem";
import expenses from "./expense";

function expense(exp) {
  return (
    <ExpenseItem
      key={exp.id}
      title={exp.title}
      amount={exp.amount}
    />
  );
}

function App() {
  return (
    <div>
      {expenses.map(expense)}
    </div>
  );
}

export default App;
